import React from "react";

const Input = ({ icon, ...rest }) => {
  return (
    <div className="relative">
      <input
        {...rest}
        className="bg-input px-3 py-1.5 text-black w-full rounded-md focus:outline-primary-dark"
      />
      <div className="absolute top-1/2 -translate-y-1/2 p-1">{icon}</div>
    </div>
  );
};

export default Input;
